import Link from 'next/link';

const Navbar = () => (
<ul>
    <li><Link href="/"><a>Home</a></Link></li>
    <li><Link href="/"><a>About Us</a></Link></li>
    <li><Link href=""><a>Sing Up</a></Link></li>
</ul>
);


export default Navbar;
